#[kani::unwind(4)]
pub fn check_format() { assert!("2".parse::<u32>().unwrap() == 2);
} The experiment showed that the MIR linker approach is much more efficient. See the table bellow for the breakdown of time (in seconds) taken for each major step of the harness verification: Stage MIR Linker Alternative compilation 22.2s 64.7s goto-program generation 2.4s 90.7s goto-program linking 0.8s 33.2s code instrumentation 0.8s 33.1 verification 0.5s 8.5s It is possible that goto-cc time can be improved, but this would also require further experimentation and expertise that we don't have today. Every option would require a custom sysroot to either be built or shipped with Kani. The table below shows the size of the sysroot files for the alternative #2 (goto-program files) vs compiler artifacts (*.rmeta files) files with -Z always-encode-mir for x86_64-unknown-linux-gnu (on Ubuntu 18.04). File Type Raw size Compressed size symtab.json 950M 26M symtab.out 84M 24M *.rmeta 92M 25M These results were obtained by looking at the artifacts generated during the same experiment.

