)); When declaring a harness, users can use the #[kani::use_stub_set(<stub_set_name>)] attribute to apply the stub set: #[cfg(kani)]
#[kani::proof]
#[kani::use_stub_set(my_io_stubs)]
fn my_harness() { ... } The name of the stub set will be resolved through the module path (i.e., they are not global symbols), using Rust's standard name resolution rules. A similar mechanism can be used to aggregate stub sets: kani::stub_set!(all_my_stubs( use_stub_set(my_io_stubs), use_stub_set(my_other_stubs),
));

